import React, { useState, lazy, Suspense, useEffect } from "react";
import {
  ChakraProvider,
  extendTheme,
  Flex,
  Box,
  VStack,
  Spinner,
  Center,
} from "@chakra-ui/react";
import "@fontsource-variable/karla/wght.css";
import Sidebar from "./components/Sidebar";
import Navbar from "./components/Navbar";
import Breadcrumbs from "./components/Breadcrumbs";
import ComingSoonComponent from './components/ComingSoonComponent';

const ProviderExamsCard = lazy(() => import("./components/ProviderExamsCard"));
const ProvidersPage = lazy(() => import("./components/ProvidersPage"));
const QuestionPanel = lazy(() => import("./components/QuestionPanel"));
const TopicBox = lazy(() => import("./components/TopicBox"));
const DownloadBox = lazy(() => import("./components/DownloadBox"));
const TopicSelector = lazy(() => import("./components/TopicSelector"));
const Dashboard = lazy(() => import("./components/Dashboard"));

const theme = extendTheme({
  fonts: {
    body: '"Karla Variable", sans-serif',
  },
  components: {
    Button: {
      variants: {
        referral: {
          height: "48px",
          fontSize: "16px",
          paddingLeft: "24px",
          paddingRight: "24px",
          borderRadius: "full",
          border: "2px solid black",
          fontWeight: 700,
          textTransform: "uppercase",
          transition: "0.3s",
          boxShadow: "0 4px 0 0 black",
          _hover: {
            transform: "translateY(2px)",
            boxShadow: "0 2px 0 0 black",
          },
          _active: {
            transform: "translateY(4px)",
            boxShadow: "none",
          },
          borderRight: "0",
          _first: {
            borderTopLeftRadius: "full",
            borderBottomLeftRadius: "full",
          },
          _last: {
            borderRight: "2px solid black",
            borderTopRightRadius: "full",
            borderBottomRightRadius: "full",
          },
        },
      },
    },
  },
});

const LoadingSpinner = () => (
  <Center
    position="fixed"
    top="0"
    left="0"
    right="0"
    bottom="0"
    backgroundColor="rgba(255, 255, 255, 0.8)"
    zIndex="9999"
  >
    <Spinner size="xl" color="#00bfff" thickness="4px" />
  </Center>
);

const MainPage = () => {
  const [isStarFilled, setIsStarFilled] = useState(false);
  const [activeItem, setActiveItem] = useState("Dashboard");
  const [currentTopic, setCurrentTopic] = useState(1);
  const [isSidebarCollapsed, setIsSidebarCollapsed] = useState(false);
  const [currentExam, setCurrentExam] = useState(null);
  const [examData, setExamData] = useState(null);
  const [currentQuestionIndex, setCurrentQuestionIndex] = useState(0);

  useEffect(() => {
    if (currentExam) {
      const fetchExamData = async () => {
        try {
          // Replace this with your actual API call
          const response = await fetch(`/api/exams/${currentExam}`);
          const data = await response.json();
          setExamData(data);
          setCurrentTopic(Object.keys(data.topics)[0]);
          setCurrentQuestionIndex(0);
          setActiveItem("Actual Exam");
        } catch (error) {
          console.error('Error fetching exam data:', error);
        }
      };

      fetchExamData();
    }
  }, [currentExam]);

  const toggleStar = (event) => {
    event.stopPropagation();
    setIsStarFilled(!isStarFilled);
  };

  const toggleSidebar = () => {
    setIsSidebarCollapsed(!isSidebarCollapsed);
  };

  const handleExamSelect = (examId) => {
    setCurrentExam(examId);
  };

  const handleTabChange = (tab) => {
    console.log(`Tab changed to: ${tab}`);
  };

  const handleSearch = (searchTerm) => {
    console.log("Searching for:", searchTerm);
  };

  const handleShuffle = () => {
    console.log("Shuffling questions");
  };

  const handleReset = () => {
    console.log("Resetting questions");
  };

  const handleSubmit = () => {
    console.log("Submitting answer");
  };

  const handleTopicChange = (topic) => {
    setCurrentTopic(topic);
    setCurrentQuestionIndex(0);
  };

  const handleQuestionChange = (index) => {
    setCurrentQuestionIndex(index);
  };

  const renderContent = () => {
    switch (activeItem) {
      case "Dashboard":
        return (
          <Box width="100%">
            <Dashboard />
          </Box>
        );
      case "Actual Exam":
        if (!examData) {
          return <LoadingSpinner />;
        }
        const currentTopicQuestions = examData.topics[currentTopic] || [];
        const currentQuestion = currentTopicQuestions[currentQuestionIndex] || {};
        return (
          <Flex>
            <Box flex={1} minWidth="0">
              <QuestionPanel
                width="100%"
                onSearch={handleSearch}
                onShuffle={handleShuffle}
                onReset={handleReset}
                onSubmit={handleSubmit}
                tabs={["ALL QUESTIONS", "FAVORITES", "ANSWERED", "UNANSWERED", "INCORRECT"]}
                onTabChange={handleTabChange}
                questionNumber={currentQuestionIndex + 1}
                totalQuestions={currentTopicQuestions.length}
                questionText={currentQuestion.questionText}
                isStarFilled={isStarFilled}
                toggleStar={toggleStar}
                options={currentQuestion.options || []}
                answer={currentQuestion.answer}
                answerDescription={currentQuestion.answerDescription}
                votes={currentQuestion.votes || []}
              />
            </Box>
            <Box width="300px" minWidth="300px" marginLeft={8}>
              <VStack spacing={8}>
                <TopicBox
                  topicNumber={currentTopic}
                  examCode={examData.examCode}
                  examTitle={examData.examTitle}
                />
                <DownloadBox />
                <TopicSelector
                  availableTopics={Object.keys(examData.topics).map(Number)}
                  currentTopic={currentTopic}
                  onTopicChange={handleTopicChange}
                />
              </VStack>
            </Box>
          </Flex>
        );
      case "Exams":
        return (
          <Box width="100%">
            <ProviderExamsCard onExamSelect={handleExamSelect} />
          </Box>
        );
      case "Providers":
        return (
          <Box width="100%">
            <ProvidersPage />
          </Box>
        );
      case "Custom Exam":
        return (
          <Box width="100%">
            <ComingSoonComponent />
          </Box>
        );
      default:
        return <Box>Content for {activeItem}</Box>;
    }
  };

  return (
    <ChakraProvider theme={theme}>
      <Flex height="100vh">
        <Sidebar
          activeItem={activeItem}
          onItemClick={setActiveItem}
          isCollapsed={isSidebarCollapsed}
          onToggleCollapse={toggleSidebar}
        />
        <Flex
          direction="column"
          flex={1}
          overflow="hidden"
        >
          <Navbar activeItem={activeItem}>
            {activeItem === "Actual Exam" && examData && (
              <Breadcrumbs
                items={[
                  { label: "All Providers", href: "#" },
                  { label: examData.provider, href: "#" },
                  {
                    label: examData.examTitle,
                    href: "#",
                    isCurrentPage: true,
                  },
                ]}
              />
            )}
          </Navbar>
          <Box flex={1} overflow="auto" padding={8}>
            <Suspense fallback={<LoadingSpinner />}>
              {renderContent()}
            </Suspense>
          </Box>
        </Flex>
      </Flex>
    </ChakraProvider>
  );
};

export default MainPage;
